			msgid: `Nosh Sprouts thrive in colder climates and produce edible <link=\\"BEAN\\">Nosh Beans</link>.`,
			msgstr: `Съедобные ростки процветают в холодном климате и дают плоды в виде <link=\\"BEAN\\">съедобных бобов</link>.`,
